import React from "react";
import "./title.scss";
import bg from "../../assets/images/bg1.jpg";
class Title extends React.Component {
  render() {
    const { countDown } = this.props;
    return (
      <div>
        <img src={bg}></img>
        <p style={{ fontSize: 40 }}>{countDown}</p>
      </div>
    );
  }
}
export default Title;
